    render() {
        return (
            <div style={{display:"flex",flexWrap:"wrap",marginLeft:"65px"}}>
                 {this.props.shows.map(show=><Main show={show} id={show.id} selectShow={this.props.selectShow} />)} 
            </div>
        ) 
}
}
